    [],nt"revision_timestamp": "2016-02-22T21:43:51.020791",nt"name": "oceanographic-survey-in-the-american-samoa-exclusive-economic-zone-eez-oes0602",nt"isopen":
    false,nt"url": null,nt"notes": "Oceanographic data were collected along
    five predetermined transects in the American Samoa EEZ and consisted of CTD casts,
    trawl samples, and continuous current and EK60 recordings.  CTD cats were conducted
    at predetermined stations.  CTDs were equipped with oxygen sensors and fluorometers.
     Trawl operations were conducted at predetermined stations along the transects
    using a Cobb trawl at depths of the shallow and deep sound scattering layers.  Currents
    were continuously monitored using a RD Instruments Acoustic Doppler Current Profiler
    (ADCP).  Biological backscatter were recorded using the EK60 echosounder system
    (38, & 120 kHz) along the transects.",nt"license_title": null,nt"extras":
